import React, { useEffect, useRef } from 'react';
import { motion } from 'framer-motion';
import { fadeInUp, staggerContainer, scaleIn, slideInLeft } from '../../utils/animations';
import './Home.css';

const Home = ({ onNavigate, selectedLocale, setSelectedLocale }) => {
  const featuresRef = useRef([]);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach(entry => {
          if (entry.isIntersecting) {
            entry.target.classList.add('visible');
          }
        });
      },
      { threshold: 0.1 }
    );

    featuresRef.current.forEach(el => {
      if (el) observer.observe(el);
    });

    return () => observer.disconnect();
  }, []);

  const features = [
    {
      icon: '📷',
      title: 'AI-Powered Identification',
      description: 'Simply take a photo or upload an image to identify waste items instantly.'
    },
    {
      icon: '🗑️',
      title: 'Smart Sorting',
      description: 'Get accurate disposal instructions based on your local recycling rules.'
    },
    {
      icon: '♻️',
      title: 'Upcycling Ideas',
      description: 'Discover creative ways to reuse items instead of throwing them away.'
    },
    {
      icon: '🌍',
      title: 'Localized Guidance',
      description: "Tailored advice for your city's specific waste management system."
    }
  ];

  const stats = [
    { number: '90%', label: 'Recycling Accuracy' },
    { number: '50+', label: 'Items Identifiable' },
    { number: '15+', label: 'Cities Supported' },
    { number: '24/7', label: 'Available' }
  ];

  const howItWorks = [
    { step: '1', title: 'Capture', description: 'Take or upload a photo of your waste item', icon: '📸' },
    { step: '2', title: 'Identify', description: 'AI analyzes and identifies the material', icon: '🔍' },
    { step: '3', title: 'Sort', description: 'Get sorting instructions for your area', icon: '♻️' },
    { step: '4', title: 'Impact', description: 'Track your environmental contribution', icon: '🌱' }
  ];

  return (
    <div className="home-page">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="container hero-content">
          <motion.div
            className="hero-text"
            variants={staggerContainer}
            initial="initial"
            animate="animate"
          >
            <motion.h1 variants={fadeInUp}>
              Smart Recycling Made <span className="highlight">Simple</span>
            </motion.h1>
            <motion.p variants={fadeInUp} className="hero-description">
              Identify, sort, and recycle correctly with AI-powered waste classification. 
              Join thousands making a difference, one item at a time.
            </motion.p>
            <motion.div variants={fadeInUp} className="hero-actions">
              <button className="btn btn-primary btn-large" onClick={() => onNavigate('identification')}>
                <span>🔍</span> Start Identifying
              </button>
              <button className="btn btn-secondary btn-large" onClick={() => onNavigate('local-rules')}>
                <span>📍</span> Find Local Rules
              </button>
            </motion.div>
            <motion.div variants={fadeInUp} className="hero-stats">
              {stats.map((stat, index) => (
                <div key={index} className="stat-item">
                  <div className="stat-number">{stat.number}</div>
                  <div className="stat-label">{stat.label}</div>
                </div>
              ))}
            </motion.div>
          </motion.div>
          <motion.div
            className="hero-visual"
            initial={{ opacity: 0, x: 50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.3 }}
          >
            <div className="hero-image-container">
              <div className="floating-element element-1">♻️</div>
              <div className="floating-element element-2">🌍</div>
              <div className="floating-element element-3">🌱</div>
              <img 
                src="https://images.unsplash.com/photo-1532996122724-e3c354a0b15b?w=600&h=600&fit=crop" 
                alt="Eco recycling illustration" 
                className="hero-image"
              />
            </div>
          </motion.div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features-section">
        <div className="container">
          <motion.div
            className="section-header"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <h2>Why Choose Smart Ecodispose?</h2>
            <p>Powerful features to make recycling effortless and effective</p>
          </motion.div>
          <div className="features-grid">
            {features.map((feature, index) => (
              <motion.div
                key={index}
                ref={el => featuresRef.current[index] = el}
                className="feature-card"
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
                viewport={{ once: true }}
                whileHover={{ y: -10, scale: 1.02 }}
              >
                <div className="feature-icon">{feature.icon}</div>
                <h3>{feature.title}</h3>
                <p>{feature.description}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* How It Works Section */}
      <section className="how-it-works-section">
        <div className="container">
          <motion.div
            className="section-header"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <h2>How It Works</h2>
            <p>Four simple steps to smarter waste management</p>
          </motion.div>
          <div className="steps-container">
            {howItWorks.map((step, index) => (
              <motion.div
                key={index}
                className="step-card"
                initial={{ opacity: 0, x: index % 2 === 0 ? -50 : 50 }}
                whileInView={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.6, delay: index * 0.15 }}
                viewport={{ once: true }}
                whileHover={{ scale: 1.05 }}
              >
                <div className="step-number">{step.step}</div>
                <div className="step-icon">{step.icon}</div>
                <h3>{step.title}</h3>
                <p>{step.description}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section">
        <div className="container">
          <motion.div
            className="cta-content"
            initial={{ opacity: 0, scale: 0.9 }}
            whileInView={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <h2>Ready to Make a Difference?</h2>
            <p>Start your sustainable journey today with Smart Ecodispose</p>
            <motion.button
              className="btn btn-primary btn-large"
              onClick={() => onNavigate('identification')}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              <span>🚀</span> Get Started Now
            </motion.button>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default Home;
